    false,nt"url": null,nt"notes": "These data are the summary statistics calculated
    for components of the herbaceous layers, and shrubs and trees from the three 0.05-ha
    circular plot habitat samples each taken in 2005 at the 15 sample points at Spears
    and Didion Ranches, Placer County, California. These values are based on point intersections
    of live vegetation with a sighting tube at 25 points on eight 12.6 m transects through
    the 0.05-ha plot. Readings were taken in the center of each habitat sampling plot
    and at 4 m, 8 m, and 12 m on each of the eight transects within the plot. The transects
    are at 45 degree increments with one transect to the north. The herb layer is vegetation
    0.5-2.0 m tall, while the tree layer vegetation is > 2.0 m tall.",nt"owner_org":
